import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import logo from '../Images/2x/plotpilot_logo.png';
import { Container, Level, Image } from 'react-bulma-components';

function Nav() {
  return (
    <Level>
      <Level.Side align="left">
        <Level.Item>
          <Link to="/">Submit a Prompt</Link>
        </Level.Item>
      </Level.Side>
      <Level.Side align="center">
        <Level.Item>
          <Link to="/">
            <Image src={logo} alt="PlotPilot Logo" className="logo-nav" />
          </Link>
        </Level.Item>
      </Level.Side>
      <Level.Side align="right"></Level.Side>
    </Level>
  );
}

export default Nav;
